sections.css:
// Color
body{
	font-family:  Helvetica, Arial, sans-serfi;
}

// Color
$gray			: #343434;
$clr1			: #00adee; 	//blue
$clr2			: #a2c11f; 	//green
$clr3			: #f96f22; 	//orange

.btn{
	padding: .5rem 1rem;
	display:inline-block;
	border:1px solid #ccc;
	&--primary{
		background-color:red;
		color:#FFF;
		border:1px solid red;
	}
	&--secondary{
		background-color:orange;
		color:#FFF;
		border:1px solid orange;
	}
}

/* Sticky footer styles
-------------------------------------------------- */
html {
	position: relative;
	min-height: 100%;
}
body {
	margin-bottom: 60px;
}
.footer {
	position: absolute;
	bottom: 0;
	width: 100%;
	height: 60px;
	background-color: #f5f5f5;
}
.container .text-muted {
	margin: 20px 0;
}

.page-content {
	margin-top: 60px;
}

